import React, { Component } from 'react';
import './App.css';

class Subject extends Component{ 
  render(){
    return(
      <head>
        <h1>Web</h1>
        world wide web!
      </head>
    );
  }
}



class App extends Component {  
  render(){
    return (
      <div className="App">
        <Subject></Subject>
      </div>
    );
  }
}

export default App;
